package com.ufgov.zc.common.zc.model;import java.io.Serializable;import java.math.BigDecimal;import java.util.Date;/** * 询价汇总表 * @author LEO */public class ZcEnquirySummary extends ZcBaseBill implements Serializable {  private BigDecimal spTotalSum;  private String haveXianHuo;  private Date reportPriceDate;  private Date gongHuoDate;  private String providerCode;  private String providerName;  private String tempId;  public String getTempId() {    return tempId;  }  public void setTempId(String tempId) {    this.tempId = tempId;  }  public BigDecimal getSpTotalSum() {    return spTotalSum;  }  public void setSpTotalSum(BigDecimal spTotalSum) {    this.spTotalSum = spTotalSum;  }  public Date getReportPriceDate() {    return reportPriceDate;  }  public void setReportPriceDate(Date reportPriceDate) {    this.reportPriceDate = reportPriceDate;  }  public String getHaveXianHuo() {    return haveXianHuo;  }  public void setHaveXianHuo(String haveXianHuo) {    this.haveXianHuo = haveXianHuo;  }  public Date getGongHuoDate() {    return gongHuoDate;  }  public void setGongHuoDate(Date gongHuoDate) {    this.gongHuoDate = gongHuoDate;  }  public String getProviderCode() {    return providerCode;  }  public void setProviderCode(String providerCode) {    this.providerCode = providerCode;  }  public String getProviderName() {    return providerName;  }  public void setProviderName(String providerName) {    this.providerName = providerName;  }}